UQ7AAAABRBsAMAAFAEwQ4AAEAR\nBDsAAABFEOwAAAAUQbADAABQxP8D1tX0Eynq6FQAAAAASUVORK5CYII="},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["# Find number of rides for each user\n","\n","day_of_week_ %>%\n","    ggplot(aes(day_of_week, number_of_rides, fill = user)) +\n","    geom_col(position = \"dodge\") +\n","    labs(\n","        title = \"Number of rides in week in 2022\",\n","        x = \"Day of week\",\n","        y = \"Number of rides by week\",\n","        fill = \"User type\"\n","    )+\n","    scale_y_continuous(labels = comma_format(big.mark = \".\",\n","                                           decimal.mark = \",\"))"]},{"cell_type":"markdown","id":"6e4c5417","metadata":{"papermill":{"duration":0.020401,"end_time":"2024-05-15T15:09:04.436736","exception":false,"start_time":"2024-05-15T15:09:04.416335","status":"completed"},"tags":[]},"source":["* During weekday, casual riders are more than members. Members use bikes weekend more than weekdays. \n","* So, we may create a solution to encourage casuals to use bike weekends."]},{"cell_type":"markdown","id":"bc503677","metadata":{"papermill":{"duration":0.020524,"end_time":"2024-05-15T15:09:04.477227","exception":false,"start_time":"2024-05-15T15:09:04.456703","status":"completed"},"tags":[]},"source":["# Conlusion\n","    Remember the questions we asked in the beginning.\n","1. How do annual members and casual riders use Cyclistic bikes differently?\n","2. Why would casual riders buy Cyclistic annual memberships?\n","3. How can Cyclistic use digital media to influence casual riders to become members?\n","\n","    Annual members and casual members use bikes differently.During weekday, casual riders are more than members. Members use bikes weekend more than weekdays. So, we may create a solution to encourage casuals to use bike weekends. Least popular bike usage time is between 02.00-08.00 which is home sleeping/resting time. Most popular bike usage time is 19.00-22.00. Casual biker travel twice longer than members. Docked bikes are used by casuals only. \n","\n","    Electric bike is most popular bike type between all riders. Classic bikers, docked bikers, and electric bikers travel almost the same distance in terms of days of week. Casual and member bikers travel for similar time. Docked bikes are used for the longest journey by casual bikers. Casual bikers travel longer than members.\n","\n","    Annual members ride bikes almost everyday of the week. However, casuals rides mostly weekdays. So, casuals would have benefits of having bike while using bikes weekeneds. Because, casuals ride longer distance than the annual members.There can be advertisent that show the advantages using bike weekend and in longer journeys. Thus, casual users could be encouraged buying annual plan. "]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":2145411,"sourceId":3570631,"sourceType":"datasetVersion"}],"dockerImageVersionId":30372,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":88.184752,"end_time":"2024-05-15T15:09:04.719985","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-05-15T15:07:36.535233","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}